import HomePage from './page/Home/HomePage'
import {BrowserRouter,Routes,Route} from 'react-router-dom'
function App() {
  return (
    <div className="font text-center" >
      <BrowserRouter>
      <Routes>
        <Route index element={<HomePage/>}/>
      </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
